import {
    Box,
    Heading, Stack,
} from "@chakra-ui/react";

function TaskPage() {
    return (
        <Box p={15} maxW="md" mx="auto">
            <Heading
                mb={"6"}
                textAlign={"center"}
                color={"green.500"}
            >
                Tasks
            </Heading>

            <Box as={"fieldset"}>
                <Stack spacing={2}>
                    <Text as={"legend"}>Create Task</Text>
                    <Box>
                        <Text>Name</Text>
                        <Input placeholder={"Name"} />
                    </Box>
                </Stack>
            </Box>
        </Box>
    );
}

export default TaskPage
